import React from 'react'

export default function Welcomebox() {
  return (
    <div>
        <div id='Main-container'>
            <div id='Welcome-text'>
                <h1>Hello, My name is Enrique.</h1>
                    <p>And I am your future software engineer!</p>
            </div>
        </div>
    </div>
  )
}
